import React from 'react'
import './AllPosts.css'
const AllPosts = () => {
    let posts = [
        {profileURL: 'https://picsum.photos/200/300', name:'amer shboul', image:"https://picsum.photos/200/300", caption:"lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm"},
        {profileURL: 'https://picsum.photos/200/300', name:'amer shboul', image:"https://picsum.photos/200/300", caption:"lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm"},
        {profileURL: 'https://picsum.photos/200/300', name:'amer shboul', image:"https://picsum.photos/200/300", caption:"lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm"},
        {profileURL: 'https://picsum.photos/200/300', name:'amer shboul', image:"https://picsum.photos/200/300", caption:"lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm"},
        {profileURL: 'https://picsum.photos/200/300', name:'amer shboul', image:"https://picsum.photos/200/300", caption:"lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm lorem ipusm"},
    ]
    return (
        <div className='posts'>
            {posts.map((post, id) => (
                <div className="post" key={id}>
                    <h1>{post.name}</h1>
                </div>
            ) )}
        </div>
    )
}

export default AllPosts
